-- ----------------------------
-- Table structure for cmf_users
-- ----------------------------
DROP TABLE IF EXISTS `cmf_users`;
CREATE TABLE `cmf_users`  (
  `id` bigint(20) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '主系统id',
  `shop_uid` int(11) NOT NULL DEFAULT 0 COMMENT '副系统id',
  `task_uid` int(11) NOT NULL DEFAULT 0 COMMENT '任务系统id',
  `openid` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `pid` int(10) NULL DEFAULT 0 COMMENT '直属上级',
  `true_name` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '真实姓名',
  `price` decimal(10, 2) NULL DEFAULT 0.00 COMMENT '余额',
  `maodou` decimal(20, 4) NULL DEFAULT NULL COMMENT '毛豆',
  `coin` decimal(20, 2) UNSIGNED NULL DEFAULT NULL COMMENT '豆丁',
  `mobile` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '',
  `level` int(5) NULL DEFAULT 0 COMMENT '会员等级398、1190、3680....',
  `team_count` int(11) NULL DEFAULT NULL COMMENT '下级团队人数',
  `votes` decimal(20, 2) NULL DEFAULT 0.00 COMMENT '映票余额',
  `commission` decimal(10, 2) NOT NULL,
  `user_login` varchar(60) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '用户名',
  `user_pass` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '登录密码；sp_password加密',
  `user_nicename` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '用户美名',
  `user_email` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '登录邮箱',
  `user_url` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '用户个人网站',
  `avatar` varchar(600) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '微信头像',
  `avatar_thumb` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '自定义头像',
  `birthday` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '生日',
  `signature` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '个性签名',
  `last_login_ip` varchar(16) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '最后登录ip',
  `last_login_time` datetime(0) NULL DEFAULT NULL COMMENT '最后登录时间',
  `create_time` datetime(0) NULL DEFAULT NULL COMMENT '注册时间',
  `user_activation_key` varchar(60) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '激活码',
  `user_status` int(11) NULL DEFAULT 1 COMMENT '用户状态 0：禁用； 1：正常 ；2：未验证',
  `score` int(11) NULL DEFAULT 0 COMMENT '用户积分',
  `user_type` smallint(1) NULL DEFAULT 1 COMMENT '用户类型，1:admin ;2:会员',
  `token` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '授权token',
  `expiretime` int(12) NULL DEFAULT 0 COMMENT 'token 到期时间',
  `consumption` int(11) NULL DEFAULT 0 COMMENT '消费总额',
  `votestotal` decimal(11, 2) NULL DEFAULT 0.00 COMMENT '映票总额',
  `id_card` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '身份证号',
  `province` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '身份证省份',
  `city` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '身份证城市',
  `area` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '身份证区县',
  `sex` smallint(1) NULL DEFAULT 1 COMMENT '性别；0：保密，1：男；2：女',
  `isrecommend` tinyint(1) NULL DEFAULT 0 COMMENT '0 未推荐 1 推荐',
  `login_type` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT 'phone' COMMENT '注册方式',
  `iszombie` tinyint(1) NULL DEFAULT 0 COMMENT '是否开启僵尸粉',
  `isrecord` tinyint(1) NULL DEFAULT 0 COMMENT '是否开起回放',
  `iszombiep` tinyint(1) NULL DEFAULT 0 COMMENT '是否僵尸粉',
  `issuper` tinyint(1) NULL DEFAULT 0 COMMENT '是否超管',
  `ishot` tinyint(1) NULL DEFAULT 1 COMMENT '是否热门显示',
  `goodnum` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '0' COMMENT '当前装备靓号',
  `source` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT 'pc' COMMENT '注册来源',
  `pid_level1` int(10) NULL DEFAULT 0 COMMENT '所属总工会id',
  `pid_level2` int(10) NULL DEFAULT 0 COMMENT '所属区域工会id',
  `pid_level3` int(10) NULL DEFAULT 0 COMMENT '所属工会id',
  `pid_level4` int(10) NULL DEFAULT 0 COMMENT '所属经纪人id',
  `distribution_type` int(10) NULL DEFAULT 0 COMMENT '0未分配；1分配给代理商；2分配到会员',
  `live_thumb` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '直播封面图',
  `city_edit` tinyint(1) NULL DEFAULT 0 COMMENT '0未编辑过，1编辑过了',
  `guankan_num` int(10) UNSIGNED NULL DEFAULT 0 COMMENT '可用观看视频次数',
  `coin_password` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '888888' COMMENT '提现密码',
  `guankan_date` int(11) NULL DEFAULT NULL COMMENT '观看截止时间',
  `guankan_auth` int(1) NULL DEFAULT 0 COMMENT '是否可永久观看',
  `is_chuchuang` tinyint(1) NULL DEFAULT 0 COMMENT '是否有橱窗',
  `is_eye_phone` tinyint(1) NULL DEFAULT 1 COMMENT '是否允许看手机号1是0否',
  `is_vip` tinyint(1) NULL DEFAULT 0 COMMENT '0不是vip，1是vip ',
  `is_up_video` tinyint(1) NULL DEFAULT 0 COMMENT '是否可发布视频0不可以1可以',
  `is_comment` tinyint(1) NULL DEFAULT 1 COMMENT '是否可评论1可以0不可以',
  `is_auth` tinyint(1) NULL DEFAULT 0 COMMENT '身份认证0未认证1认证',
  `experience` decimal(11, 2) NULL DEFAULT 0.00 COMMENT '经验值',
  `master_level` tinyint(1) NULL DEFAULT 0 COMMENT '达人等级',
  `auth_time` int(11) NULL DEFAULT NULL COMMENT '实名认证时间',
  `exchange_level_id` tinyint(1) NULL DEFAULT 0 COMMENT '兑换等级id',
  `partner_id` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '合伙者身份id',
  `activecount` decimal(20, 2) NULL DEFAULT 0.00 COMMENT '活跃度',
  `activecountplus` decimal(20, 2) NULL DEFAULT 0.00 COMMENT '加成活跃度',
  `frozen_maodou` decimal(20, 4) NULL DEFAULT 0.0000 COMMENT '冻结毛豆',
  `frozen_coin` decimal(20, 4) NULL DEFAULT NULL COMMENT '冻结能量',
  `is_transfer_maodou` tinyint(1) NULL DEFAULT 0 COMMENT '0不可互转1，可以转毛豆给用户',
  `transfer_maodou_num` decimal(12, 2) NULL DEFAULT 0.00 COMMENT '一次最多可以转多少',
  `auth_address` int(10) NULL DEFAULT NULL COMMENT '认证地址（涉及分佣，认证后无法更改）',
  `maodouconsumption` decimal(20, 4) NULL DEFAULT 0.0000 COMMENT '毛豆消费统计',
  `family_active` decimal(10, 2) NULL DEFAULT 0.00 COMMENT '家族活跃度',
  `lian_active` int(10) NULL DEFAULT 0 COMMENT '联盟活跃度',
  `surplus_count` tinyint(1) UNSIGNED NULL DEFAULT 5 COMMENT '活跃度校对次数',
  `is_high_grade_auth` tinyint(1) NULL DEFAULT 0 COMMENT '是否可发布一乡一品视频',
  `update_surplus_time` int(11) NULL DEFAULT 0 COMMENT 'id跟新校准时间',
  `family_auth_number` int(11) NULL DEFAULT 0 COMMENT '家族认证总人数',
  `family_number` int(11) NULL DEFAULT 0 COMMENT '家族总人数',
  `js_uid` int(11) NULL DEFAULT NULL COMMENT '集市用户',
  `area_code` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '省市编号',
  `auth_maodou` decimal(11, 4) NULL DEFAULT 0.0000 COMMENT '直推认证福利',
  `tg_commission` decimal(11, 2) UNSIGNED NULL DEFAULT 0.00 COMMENT '推广佣金',
  `is_tongbu` tinyint(1) NULL DEFAULT 0 COMMENT '是否同步商城数据',
  `nickname` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `user_login`(`user_login`) USING BTREE,
  INDEX `user_login_key`(`user_login`) USING BTREE,
  INDEX `index_ishot_isrecommend`(`ishot`, `isrecommend`) USING BTREE,
  INDEX `user_nicename`(`user_nicename`) USING BTREE,
  INDEX `family_active`(`family_active`) USING BTREE,
  INDEX `idx_mobile`(`mobile`) USING BTREE,
  INDEX `pid_is_auth`(`pid`, `is_auth`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 654477 CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Compact;

-- ----------------------------
-- Records of cmf_users
-- ----------------------------

SET FOREIGN_KEY_CHECKS = 1;
